import "./App.css";
import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Routes,
} from "react-router-dom";
import { Connector } from "./Screens/Connector";

export const RouterPath = {
  CONNECT: "/",
};

function App() {

  return (
    <>
      <Router>
        <Routes>
          <Route
            path={RouterPath.CONNECT}
            element={<Connector />}
          />
        </Routes>
      </Router>
    </>
  );
}

export default App;
